import React, { Component } from 'react'
import data from './data'

const usersData = data.user;
export default class DashBoard extends Component {
    render() {
        console.log(data)
        return (
            <div>
               <h1>DashBoard with data: </h1>
               <ul>
                    {
                        usersData.map((s,i) => (<li>{s.id}</li>))
                    }
                </ul>
            </div>
        )
    }
}
